import MovieItem from "./components/MovieItem";
import { movies } from "./data/Movies";

function App() {
  return (
    <div>
      <h2>Let's get started!</h2>
      {movies.map((expense) => {
        return (
          <div key={expense.id}>
            <MovieItem
              date={expense.date}
              title={expense.title}
              amount={expense.amount}
            ></MovieItem>
          </div>
        );
      })}
    </div>
  );
}

export default App;
